import React from "react";

import "./CardsPrin.css";


function App() {
  return (

      <div className="wrapper">
      <Card
        img="https://images.unsplash.com/photo-1536304929831-ee1ca9d44906?ixlib=rb-1.2.1&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=400&fit=max&ixid=eyJhcHBfaWQiOjE0NTg5fQ"
        title="The Everyday Salad"
        description="Take your boring salads up a knotch. This recipe is perfect for lunch
          and only contains 5 ingredients!"
      />
    </div>
  )

  }

function CardsPrin(props) {
  return(
    <div> 
     <h2 class="text-center m-4">NUESTROS PRODUCTOS</h2>
     <div class="contenedor">
       <div class="contenedor-cards">
         <div class="contenedor-card-item">
         <div class="contenedor-card-item-wrapper">
         <img src={props.img} alt=""/>
         <div class="contenedor-info">
         <div class="info"> 
         <p class="tittle">{props.title}</p>
          </div>
          <div class="fondo"></div>
         </div>
         </div>
         </div>
       </div>
     </div>


    </div>

  );
}
export default CardsPrin;
